import styles from "../components/styles/news.module.css";
import Navbar from "./navbar";
import NewsCard1 from "./assets.news1.jpg";
import NewsCard2 from "./assets.news2.jpg";
import NewsCard3 from "./assets.news3.jpg";
import NewsCard4 from "./assets.news4.jpg";

const News = (props) => {
  const news = [
    { news: "1", image: Card1 },
    { news: "2", image: Card2 },
    { news: "3", image: Card3 },
    { news: "4", image: Card4 },
  ];
  return (
    <div className={styles.news}>
      <div className={styles.heading}>
        <span className={styles.headingSpan}>ბოლო სიახლეები</span>
        <div className={styles.newsCards}>
          {news.map((item) => (
            <NewsCard {...item} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default News;
